import React, { Fragment } from 'react';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { FaPhoneAlt } from "react-icons/fa";
import CStyle from './Style/Contact-s';
class contect extends React.Component {
    render() {
        return (
            <Fragment>
                < CStyle />
                <div className="contect">
                    <p className="h-c">CONTECT US </p>
                    <FontAwesomeIcon icon={faEnvelope} className="fontawesome" />
                    <span className="span">rkc2802@gmail.com</span> <br />
                    <FaPhoneAlt className="fontawesome" />9990335432
                </div>
            </Fragment>
        );
    }
}
export default contect;
